import React from "react";
import PortfolioCard from "./portfolio-card";

function Footer() {
  const enzo = require("./images/enzo-10-4-2019sml.jpeg");
  return (
    <PortfolioCard
      attributes={{
        title: "CRM",
        img: enzo,
        bkgd: "pink"
      }}
    />
  );
}

export default Footer;
